import Header from "./components/Header.js";
import Welcome from "./components/Welcome.js";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import FourYearPlanBreakdown from "./components/FourYearPlanBreakdown.js";

function App() {
  return (
    <div className="App">
      <div className="bg-neutral-900">
        <Router>
          <Routes>
            <Route path="/" element={<Welcome />} />
            <Route path="/four-year-plan" element={<FourYearPlanBreakdown />} />
          </Routes>
          <Header />
        </Router>
        </div>
    </div>
  );
}

export default App;
